import React, { Component } from 'react'
import socketIOClient from "socket.io-client"; 
const config = require('./../config.json');

export default class App extends Component {

  constructor (props){
    super(props)
    this.state = {
      timesLoaded: false,
      dataLoaded: false,
      items: {}
    }
  }

  componentDidMount(){
    const socket = socketIOClient(config.app.host+":"+config.app.port);
    socket.on("newTimes", data => {
      this.setState({
        timesLoaded: true,
        items: data
      });
      console.log(data)
    });

    socket.on("newData", data => {
      this.setState({
        dataLoaded: true,

      });
      console.log(data)
    });
  }

  render() {
    const {timesLoaded, dataLoaded, items } = this.state;
